import Todo from "../Todo/Todo";
const TodoList = ({ todo, remove }) => {
  return (
    <div>
      {todo.map(todo => <Todo
        key={todo.id}
        todo={todo}
        inYear={todo.inYear}
        remove={remove}
      />)}
    </div>
  );
}

export default TodoList;
